import axios from "axios";
export async function  updateToDo ({todo,completed})  {
    
    return axios.patch(`http://localhost:8000/${todo._id}`,{completed})
      .then((res) => console.log(res.data))
      .catch(function (error) {
        console.log(error);
      });
        
     
  }
